import { PutObjectCommand, ListObjectsCommand, S3Client } from "@aws-sdk/client-s3";
import fetch from "node-fetch";
import dotenv from "dotenv";
import scheduler from "node-schedule";

const emptyMint = {
    "id" : 0,
    "owner" : "0x0000000000000000000000000000000000000000",
    "totalChanges" : 0,
    "place" : ""
}

dotenv.config();

const s3Client = new S3Client({
    endpoint: "https://fra1.digitaloceanspaces.com",
    region: "us-east-1",
    credentials: {
        accessKeyId: process.env.KEY_ID,
        secretAccessKey: process.env.SECERT_KEY
    }
});

let scheduleLock = false;

scheduler.scheduleJob('0 * * * * *', async function() {
    if(scheduleLock == false) {
        scheduleLock = true;

        await checkMints();

        scheduleLock = false;
    }
});

function setChatAt(str, index, chr) {
    return str.substring(0, index) + chr + str.substring(index + 1);
}

async function checkMints() {
    const totalMints = await queryLastMintId() + 1;
    const mintFiles = await listMints();
    let missingMints = [];

    for(let i = 0; i < totalMints; i++) {
        let missing = true;
        for(let f = 0; f < mintFiles.length; f++) {
            if(mintFiles[f]["Key"] == "mints/place_" + i + ".json") {
                missing = false;
                break;
            }
        }
        if(missing) {
            missingMints.push(i);
        }
    }

    for(let m = 0; m < missingMints.length; m++) {
        let mint = emptyMint;

        const mintData = await queryMint(missingMints[m]);
        mint["id"] = missingMints[m];
        mint["owner"] = mintData["owner"];
        mint["totalChanges"] = mintData["totalChanges"];
      
        for(let p = 0; p < 200; p++) {
            let promises = [];
    
            for(let i = 0; i < 50; i++) {
                let lower = (p * 5000) + (i * 100);
                let upper = lower + 100;
    
                promises.push(queryPixels(lower, upper, mintData["totalChanges"]));
            }
    
            const responses = await Promise.all(promises);
    
            for(let r = 0; r < responses.length; r++) {
                for(let i = 0; i < responses[r].length; i++) {
                    let position = parseInt(responses[r][i]["position"]);
                    let color = parseInt(responses[r][i]["color"]).toString(16);
                    mint["place"] = setChatAt(mint["place"], position, color);
                }
            }
        }
        await updateMintedPlace(mint, "place_" + missingMints[m] + ".json");
    }
}

async function updateMintedPlace(mintJson, fileName) {
    const params = {
        Bucket: "onchainplace",
        Key: ("mints/" + fileName),
        Body: JSON.stringify(mintJson),
        ACL: "public-read",
        ContentType: "application/json"  
    };

    await s3Client.send(new PutObjectCommand(params));

    console.log(new Date().toLocaleString() + " | mint updated! id: " + mintJson["id"].toString());
}

async function listMints() {
    const params = {
        Bucket: "onchainplace",
        Prefix: "mints/place_",
        Delimiter: "/"
    };

    const response = await s3Client.send(new ListObjectsCommand(params));
    return response["Contents"];
}

async function queryLastMintId() {
    const query = `{ tokens(first:1 orderBy:totalChanges orderDirection:desc) {
        id
    }}`;

    var queryResponse;

    await fetch('https://api.thegraph.com/subgraphs/name/paranoidsyntaxerror/onchain-place', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
        },
        body: JSON.stringify({
            query
        })
    })
    .then(response => response.json())
    .then(responseJson => {
        queryResponse = responseJson["data"]["tokens"];
    });

    return parseInt(queryResponse[0]["id"]);
}

async function queryMint(id) {
    const query = `query response($id:ID) {
        tokens(where:{id:$id}) {
            owner
            totalChanges
        }
    }`;

    var queryResponse;

    await fetch('https://api.thegraph.com/subgraphs/name/paranoidsyntaxerror/onchain-place', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
        },
        body: JSON.stringify({
            query,
            variables: { id }
        })
    })
    .then(response => response.json())
    .then(responseJson => {
        queryResponse = responseJson["data"]["tokens"];
    });

    return queryResponse[0];
}

async function queryPixels(lower, upper, changes) {
    const query = `query response($lower:BigInt $upper:BigInt $changes:BigInt) {
        pixels(orderBy:position where:{position_gte:$lower position_lt:$upper totalChanges_lte:$changes}) {
            position
            color
        }
    }`;

    var queryResponse;

    await fetch('https://api.thegraph.com/subgraphs/name/paranoidsyntaxerror/onchain-place', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
        },
        body: JSON.stringify({
            query,
            variables: { lower, upper, changes }
        })
    })
    .then(response => response.json())
    .then(responseJson => {
        queryResponse = responseJson["data"]["pixels"];
    });

    return queryResponse;
}